requestBooksWithoutGenres:
query {
  onlinePaginatedAuthorsWithInnerJoin{
    id
    firstName
   books {id chapters{number} oneToOneEntity{name}}  }
}

requestBooksWithGenres:
query {
  onlinePaginatedAuthorsWithInnerJoin{
    id
    firstName
   books {id chapters {number} oneToOneEntity{name} genres {name}}  }
}
